const injectScript = require('injectScript');
const encodeUriComponent = require('encodeUriComponent');
const queryPermission = require('queryPermission');
const setDefaultConsentState =require('setDefaultConsentState');
const logToConsole = require('logToConsole');
const Object = require('Object');
const localStorage = require('localStorage');
const JSON = require('JSON');
const isConsentGranted = require('isConsentGranted');
const updateConsentState = require('updateConsentState');
const callLater = require('callLater');

const WAIT_FOR_UPDATE = 1000; // ms

setDefaultConsentState({
  'ad_storage': data.defaultConsentPreferences,
  'analytics_storage': data.defaultConsentPreferences,
  'functionality_storage': data.defaultConsentPreferences,
  'personalization_storage': data.defaultConsentPreferences,
  'security_storage': data.defaultConsentPreferences,

  'td_unclassified': data.defaultConsentPreferences,

  'wait_for_update': WAIT_FOR_UPDATE
});

const optInRegions = data.optInRegions;
if (optInRegions && optInRegions.length > 0) {
  logToConsole('optInRegions =' + JSON.stringify(optInRegions));
  setDefaultConsentState({
    'ad_storage': 'denied',
    'analytics_storage': 'denied',
    'functionality_storage': 'denied',
    'personalization_storage': 'denied',
    'security_storage': 'denied',

    'td_unclassified': 'denied',

    'wait_for_update': WAIT_FOR_UPDATE,
    'region': optInRegions,
  });
}

const optOutRegions = data.optOutRegions;
if (optOutRegions && optOutRegions.length > 0) {
  logToConsole('optOutRegions =' + JSON.stringify(optOutRegions));
  setDefaultConsentState({
    'ad_storage': 'granted',
    'analytics_storage': 'granted',
    'functionality_storage': 'granted',
    'personalization_storage': 'granted',
    'security_storage': 'granted',

    'td_unclassified': 'granted',

    'wait_for_update': WAIT_FOR_UPDATE,
    'region': optOutRegions,
  });
}

// We need to update permission if the key is modified.
const LOCAL_STORAGE_KEY = 'td_consent_preferences';

const rawData = localStorage.getItem(LOCAL_STORAGE_KEY);
const savedPreferences = JSON.parse(rawData || '{}');

const urlParameters = {
  lastConsentUpdatedAt: null,
  s: data.contextSettingJsonUrl,
};

if (savedPreferences.createdAt) {
  logToConsole('Found the saved preferences');
  logToConsole(savedPreferences);
  urlParameters.lastConsentUpdatedAt = savedPreferences.createdAt;
  const consents = {};
  savedPreferences.consents.forEach(consent => {
    if (consent.gtmConsentName) {
      consents[consent.gtmConsentName] = consent.status;
    }
  });

  logToConsole('update consent status with the following parameter');
  logToConsole(consents);
  updateConsentState(consents);
}

const consents = [
  'ad_storage',
  'analytics_storage',
  'functionality_storage',
  'personalization_storage',
  'security_storage',
  'td_unclassified',
];

callLater(function() {
  logToConsole('callLater triggerred!');

  logToConsole('--- current consent ---');
  consents.forEach(consentName => {
    const val = isConsentGranted(consentName) ? 'granted' : 'denied';
    logToConsole(consentName + ' = ' + val);
    urlParameters[consentName] = val;
  });

  const queries = Object.entries(urlParameters).map(function(arr) {
    const key = arr[0];
    const raw = arr[1] || '';
    logToConsole(raw);
    const val = encodeUriComponent(raw);
    logToConsole(val);
    return key.toString() + "=" + val;
  }).join('&');

  const scriptUrl = data.loaderJsUrl + '?' + queries;
  logToConsole(scriptUrl);

  if (queryPermission('inject_script', scriptUrl)) {
    injectScript(scriptUrl, data.gtmOnSuccess, data.gtmOnFailure);
  } else {
    data.gtmOnFailure();
  }
}, WAIT_FOR_UPDATE / 2);



